import React from 'react';

class BoardOfDirectors extends React.Component {
    render() {
        return (
            <div className="jumbotron">
            <h1 className="display-4">Boards Of Directors</h1>
            <PhotoGrid />
            <p></p>

            <hr className="my-4"></hr>
